drop table datapool;
CREATE TABLE DATAPOOL (
    IME VARCHAR2(50),
    PREZIME VARCHAR2(50),
    TVRTKA VARCHAR2(100),
    DOLAZAK TIMESTAMP,
    ODLAZAK TIMESTAMP,
    OCJENA NUMBER(1),
    KOMENTAR VARCHAR2(255)
);

